import './App.css';
import Header from './components/Header';
import MainContainer from './components/MainContainer'
import {useEffect} from 'react';

import {ApiFunction} from 'components/ApiFunction.js'

function App() {

  useEffect(() => {
    ApiFunction()
  }, [])

  return (
    <div className="App">
      <Header/>
      <MainContainer/>
    </div>
  );
}

export default App;
